import{_ as a,o as e,c as l,e as i}from"./chunks/framework.nzJD8CNM.js";const t="/assets/map-9e194e5b83e57189e9661e0dfb10a61024b1e0a938007af7b3f84bf503392f8d.hrXP_Bkb.png",q=JSON.parse('{"title":"Делай вещь","description":"Центр производственной культуры","frontmatter":{"title":"Делай вещь","description":"Центр производственной культуры","date":"2016-01-07","icon":"logo.jpg","cover":"cover.jpg","vk":"delaivesch","youtube-channel":"UCBBu44T-qCxkUyPWBCe4Xgw","instagram":"delaivesch","telegram":"delai_vesch","tel":"+7 (495) 280-18-12","coord":[55.762084935290204,37.55876897186813],"status":"open"},"headers":[],"relativePath":"workshop/catalog/delaivesch/index.md","filePath":"workshop/catalog/delaivesch/index.md"}'),o={name:"workshop/catalog/delaivesch/index.md"},r=i('<h2 id="место-где-каждыи-может-получить-доступ-к-самому-высокотехнологичному-инструменту" tabindex="-1">Место, где каждый может получить доступ к самому высокотехнологичному инструменту. <a class="header-anchor" href="#место-где-каждыи-может-получить-доступ-к-самому-высокотехнологичному-инструменту" aria-label="Permalink to &quot;Место, где каждый может получить доступ к самому высокотехнологичному инструменту.&quot;">​</a></h2><h3 id="пространство-для-работы-над-своими-проектами-и-возможность-учиться-в-сообществе-дизаинеров-архитекторов-мастеров-инженеров-и-художников" tabindex="-1">Пространство для работы над своими проектами и возможность учиться в сообществе дизайнеров, архитекторов, мастеров, инженеров и художников. <a class="header-anchor" href="#пространство-для-работы-над-своими-проектами-и-возможность-учиться-в-сообществе-дизаинеров-архитекторов-мастеров-инженеров-и-художников" aria-label="Permalink to &quot;Пространство для работы над своими проектами и возможность учиться в сообществе дизайнеров, архитекторов, мастеров, инженеров и художников.&quot;">​</a></h3><h3 id="коворкинг" tabindex="-1">КОВОРКИНГ <a class="header-anchor" href="#коворкинг" aria-label="Permalink to &quot;КОВОРКИНГ&quot;">​</a></h3><p>Арендуй стол для работы в хорошо оборудованной столярной мастерской</p><h3 id="производство" tabindex="-1">ПРОИЗВОДСТВО <a class="header-anchor" href="#производство" aria-label="Permalink to &quot;ПРОИЗВОДСТВО&quot;">​</a></h3><p>Закажи вещь любой сложности для своего дома, хобби или бизнеса</p><h3 id="курсы" tabindex="-1">КУРСЫ <a class="header-anchor" href="#курсы" aria-label="Permalink to &quot;КУРСЫ&quot;">​</a></h3><p>Узнай больше о столярном мастерстве и делай вещи вместе с нами</p><h3 id="мероприятия" tabindex="-1">МЕРОПРИЯТИЯ <a class="header-anchor" href="#мероприятия" aria-label="Permalink to &quot;МЕРОПРИЯТИЯ&quot;">​</a></h3><p>Присоединяйся к сообществу единомышленников</p><p>Открытая столярная мастерская «Делай Вещь!» — это революционный формат мастерской, организованной по принципу makerspace. Пространство мастерской — трансформируемый лофт в трех минутах от метро «Улица 1905 года» — объединяет функции столярного коворкинга, производственной базы, ателье мебели, школы дизайна и технологий. Наш призыв #ДЕЛАЙВЕЩЬ обращен к одному из самых глубоких принципов человека — принципу самовыражения через созидание. Современный городской житель сделал огромный рывок в виртуальное пространство и обладает впечатляющим багажом интеллектуальных знаний. Осталось немногое — вернуться в реальный мир и сделать его немного лучше. Делать своими руками материальные объекты, видеть, как другие люди пользуются тем, что ты сделал, учиться через игру с технологиями и материалами, чувствовать поддержку единомышленников — именно для этого наш мастерская «Делай Вещь!» открыта 24/7. Приходи и #ДЕЛАЙВЕЩЬ вместе с нами!</p><p>Список оборудования мастерской (<a href="https://docs.google.com/document/d/1XK393LM_-EsHVy0t6C0JFkX9lTnFd41ZKNNNwY4gkKQ/edit" class="external-link" target="_blank" rel="noreferrer">отсюда</a>)</p><h3 id="ручнои-электроинструмент" tabindex="-1">Ручной электроинструмент <a class="header-anchor" href="#ручнои-электроинструмент" aria-label="Permalink to &quot;Ручной электроинструмент&quot;">​</a></h3><h3 id="оборудование-для-раскроя-и-распила-материалов" tabindex="-1">Оборудование для раскроя и распила материалов <a class="header-anchor" href="#оборудование-для-раскроя-и-распила-материалов" aria-label="Permalink to &quot;Оборудование для раскроя и распила материалов&quot;">​</a></h3><ul><li>Погружные пилы Festool TS55</li><li>Шины направляющие для погружных пил: от 800 до 3000 мм</li><li>Лобзики электрические: Festool, Makita, Bosch</li><li>Пила для продольного распила: Festool TS75 в столе CMS</li><li>Торцовочная пила: Festool Kapex KS 120</li><li>Ленточная пила LB1200F</li><li>Комбинированная пила Makita LH 1200 FL (для продольного пиления и торцевания)</li><li>Форматно-раскроечный станок ROJEK PA250 c кареткой 2000мм <em>(Только совместная работа с персоналом мастерской)</em></li></ul><h3 id="фрезерование" tabindex="-1">Фрезерование <a class="header-anchor" href="#фрезерование" aria-label="Permalink to &quot;Фрезерование&quot;">​</a></h3><ul><li>Кромочный фрезер Makita RP 2300FC</li><li>Фрезер ручной Festool OF 1400 и 2200</li><li>Фрезер Makita RT0700C</li><li>Дюбельный фрезер DOMINO DF-500</li><li>Шипорезная система VS 600</li><li>Кромочный фрезер Festool OF K 700 EQ</li></ul><h3 id="шлифование" tabindex="-1">Шлифование <a class="header-anchor" href="#шлифование" aria-label="Permalink to &quot;Шлифование&quot;">​</a></h3><ul><li>Ленточные шлифовальные машины Makita 9404</li><li>Эксцентриковая шлифовальная машина Festool ETS125</li><li>Орбитальные шлифмашинки Mirka Deros 650</li><li>Аккумуляторная шлифовальная машинка для шлифования в труднодоступных местах Bosch PSM 10.8</li><li>Орбитальная шлифовальная машина BOSCH GEX 125-1 AE</li></ul><h3 id="сверление" tabindex="-1">Сверление <a class="header-anchor" href="#сверление" aria-label="Permalink to &quot;Сверление&quot;">​</a></h3><ul><li>Шуроповерты монтажные маленькие: Makita, Miluwakee, Bosch</li><li>Шуруповерты силовые: Festool, Miluwakee</li><li>Дрели проводные: Metabo, Makita</li><li>Станок сверлильный Bosch PBD40</li></ul><h3 id="токарная-обработка" tabindex="-1">Токарная обработка <a class="header-anchor" href="#токарная-обработка" aria-label="Permalink to &quot;Токарная обработка&quot;">​</a></h3><ul><li>Станок токарный JET JWL 1443 + оснастка (токарный патрон, резцы)</li></ul><h3 id="фугование-и-строгание" tabindex="-1">Фугование и строгание <a class="header-anchor" href="#фугование-и-строгание" aria-label="Permalink to &quot;Фугование и строгание&quot;">​</a></h3><ul><li>Фуговально-рейсмусовый станок DeWALT D 27300</li></ul><h3 id="пневмоинструмент" tabindex="-1">Пневмоинструмент <a class="header-anchor" href="#пневмоинструмент" aria-label="Permalink to &quot;Пневмоинструмент&quot;">​</a></h3><ul><li>Компрессор воздушный FIAC</li><li>Компрессор воздушный Shnaider</li><li>Пневмопистолеты гвоздезабивные Trusty, Porter Cable</li><li>Шпилькозабивной пистолет Porter Cable</li><li>Пневмопистолет (аккумуляторный) Ryobi</li></ul><h3 id="заточное-оборудование" tabindex="-1">Заточное оборудование <a class="header-anchor" href="#заточное-оборудование" aria-label="Permalink to &quot;Заточное оборудование&quot;">​</a></h3><ul><li>Точило электрическое Elitech CT600C</li><li>Точило Scheppah с водным камнем и полировальным кругом</li><li>Набор водных камней для заточки ручного инструмента</li></ul><h3 id="пылеудаление-и-аспирация" tabindex="-1">Пылеудаление и аспирация <a class="header-anchor" href="#пылеудаление-и-аспирация" aria-label="Permalink to &quot;Пылеудаление и аспирация&quot;">​</a></h3><ul><li>Пылесосы Festool Mini,  Midi, CTL 26, Virutex с розеткой для подключения электроинструмента и автоматическим включением при использовании.</li></ul><h3 id="ручнои-инструмент-необходимыи-для-выполнения-всех-необходимых-операции" tabindex="-1">Ручной инструмент необходимый для выполнения всех необходимых операций. <a class="header-anchor" href="#ручнои-инструмент-необходимыи-для-выполнения-всех-необходимых-операции" aria-label="Permalink to &quot;Ручной инструмент необходимый для выполнения всех необходимых операций.&quot;">​</a></h3><ul><li>Пилы, стамески, киянки, молотки, струбцины винтовые, рычажные и быстрозажимные, гаечные ключи, напильники, степлер, измерительный и разметочный инструмент, шарнирно-губцевый инструмент в ассортименте (пассатижи, кусачки, плоскогубцы)</li></ul><h3 id="фрезерно-гравировальныи-станок" tabindex="-1">Фрезерно-гравировальный станок <a class="header-anchor" href="#фрезерно-гравировальныи-станок" aria-label="Permalink to &quot;Фрезерно-гравировальный станок&quot;">​</a></h3><ul><li>Размеры стола 600х900х90мм</li></ul><h3 id="пресс-для-фанерования-и-склеики-массивных-элементов" tabindex="-1">Пресс для фанерования и склейки массивных элементов <a class="header-anchor" href="#пресс-для-фанерования-и-склеики-массивных-элементов" aria-label="Permalink to &quot;Пресс для фанерования и склейки массивных элементов&quot;">​</a></h3><h3 id="комната-для-покраски-с-вентиляциеи" tabindex="-1">Комната для покраски с** **вентиляцией <a class="header-anchor" href="#комната-для-покраски-с-вентиляциеи" aria-label="Permalink to &quot;Комната для покраски с** **вентиляцией&quot;">​</a></h3><h3 id="лазерныи-гравер-резак" tabindex="-1">Лазерный гравер / резак <a class="header-anchor" href="#лазерныи-гравер-резак" aria-label="Permalink to &quot;Лазерный гравер / резак&quot;">​</a></h3><ul><li>Размер 1200х900мм</li></ul><p><em>Резка всех материалов(фанера,картон,акрил и т.д.) кроме металла.</em></p><p><em>Гравировка на всех материалах.</em></p><p>Тарифы открытой столярной мастерской “Делай Вещь!” (свежие данные <a href="https://docs.google.com/document/d/1zP3J6WtsPvVv04u-nNI4QWvDYOgVBsiB95vfxoFJ8xc/edit" class="external-link" target="_blank" rel="noreferrer">в документе</a>)</p><h3 id="новички" tabindex="-1">Новички: <a class="header-anchor" href="#новички" aria-label="Permalink to &quot;Новички:&quot;">​</a></h3><p>Люди пришедшие в мастерскую первый раз, желающие сразу что-нибудь сделать своими руками. В стоимость входит базовый инструктаж по работе необходимым инструментом, контроль самостоятельной работы с инструментом, помощь инструктора при работе.</p><ul><li>Разовое посещение — 1000 р/час (500 рублей — аренда места и базовый инструмент,   500 рублей — инструктор-ангел)</li><li>Дневное посещение — 5000 р/день (ограничение по работе не более 8 часов в день.)</li></ul><h3 id="любители" tabindex="-1">Любители: <a class="header-anchor" href="#любители" aria-label="Permalink to &quot;Любители:&quot;">​</a></h3><p>(квалификация определяется старшим мастером)</p><p>Более-менее постоянные посетители мастерской, прошедшие инструктаж по работе с базовым комплектом инструмента в частном порядке или прошедшие курс “Основы Мастерства”. Возможность самостоятельной работы с инструментом доступным в общественной части мастерской.</p><ul><li>Разовое посещение — <strong><em>500</em></strong> р/час (аренда места и базовый инструмент)</li><li>Посещение на “пол-дня” - 1500р/посещение (ограничение по работе не более 4 часов, <strong><em>ставка 375 р/час</em></strong>)</li><li>Дневное посещение — 2500 р/день (ограничение по работе не более 8 часов в день, <strong><em>ставка 312,5 р/час</em></strong>)</li></ul><h3 id="резиденты" tabindex="-1">Резиденты: <a class="header-anchor" href="#резиденты" aria-label="Permalink to &quot;Резиденты:&quot;">​</a></h3><p>(квалификация определяется старшим мастером)</p><p>Опытные посетители мастерской, имеющие доступ ко всем иснтрументам общественной части, работающие над собственными проектами, как коммерческими, так и личными. Статус резидента можно получить после прохождения  курса “Основы Мастерства” и собеседования с одним из старших мастеров (Швайков, Крутелев). Время работы - в стандартные рабочие часы мастерской, с 10 до 20, работа вне данных временых рамок (вечером, ночью, в выходные) - возможна, но согласовывается отдельно с каждым резидентом.</p><ul><li>Абонемент на 5 дней* - 10000 р/месяц (любые 5 дней в месяц, <strong><em>ставка 250р/час</em></strong>)</li><li>Абонемент на 10 дней* - 15000 р/месяц (любые 10 дней в месяц, <strong><em>ставка 187,5 р/час</em></strong>)</li><li>Абонемент на 20 дней* - 25000 р/месяц (<strong><em>ставка 156 р/час</em></strong>)</li></ul><ul><li>ограничение не более 8ми часов в день</li></ul><p><em>Также у нас действуют накопительные скидки для постоянных посетителей мастерской. За подробностями обращайтесь к администратору.</em></p><h3 id="аренда-места-для-хранения-проектов" tabindex="-1"><strong>Аренда места для хранения проектов.</strong> <a class="header-anchor" href="#аренда-места-для-хранения-проектов" aria-label="Permalink to &quot;**Аренда места для хранения проектов.**&quot;">​</a></h3><p>Хранение пользовательских проектов, оплачивается из расчета 50р в день, за 1 кв.м. занимаемой площади. Этого пространства обычно достаточно для хранения, но если вам необходимо больше места, вы всегда можете арендовать дополнительную площадь. Оплате подлежат  дни, когда <strong>над проектом не идет работа,</strong> если вы пришли работать в мастеркой - то за этот день хранение оплачивать не нужно.</p><p><img src="'+t+'" alt=""></p>',58),h=[r];function n(s,d,c,u,m,b){return e(),l("div",null,h)}const k=a(o,[["render",n]]);export{q as __pageData,k as default};
